import { Link } from "react-router-dom";
const Navbar = ()=>{
    return(
        <nav className="navbar">
            <h1>The Sony Blog</h1>
            <div className="links">
                <Link to="/Home"style={{ 
                    color: 'white', 
                    backgroundColor: '#f1356d',
                    borderRadius: '8px'
                }}>Home</Link>
                <Link to="/create" style={{ 
                    color: 'white', 
                    backgroundColor: '#f1356d',
                    borderRadius: '8px'
                 }} >New Blog</Link>
            </div>
        </nav>
    );
}

export default Navbar;
